namespace API.ReportGenerator.Rendering;

public interface IStyleRenderer
{
    string Render();
}

public class StyleRenderer : IStyleRenderer
{
    public string Render()
    {
        var html = $$"""
                     <style>
                         @font-face {
                             font-family: "OpenSansNormal";
                             src: url("data:font/truetype;base64,") format("truetype");
                             font-weight: 400;
                             font-style: normal;
                         }
                         @font-face {
                             font-family: "OpenSansBold";
                             src: url("data:font/truetype;base64,") format("truetype");
                             font-weight: 700;
                             font-style: normal;
                         }
                         @font-face {
                             font-family: "OpenSansBolder";
                             src: url("data:font/truetype;base64,") format("truetype");
                             font-weight: 800;
                             font-style: normal;
                         }

                         /* CSS Variables */
                         :root {
                             --dark-blue-text: #002433;
                             --grey-background-color: #F9FAFB;
                             --letter-space-05: 0.05em;
                             --letter-space--03: -0.03em;
                             --letter-space--015: -0.015em;
                             --logo-height: 40px;
                         }

                     @media print {
                         @page {
                             size: 210mm 297mm;
                             margin: 0;
                         }
                         body {
                             zoom: 123%
                         }
                         .watermark {
                             position: fixed;
                             top: 50%;
                             left: 50%;
                             transform: translate(-50%, -50%) rotate(-45deg);
                             font-size: 200px;
                             color: rgba(0, 0, 0, 0.10);
                             white-space: nowrap;
                             pointer-events: none;
                             user-select: none;
                             z-index: 0;
                             font-weight: bold;
                             font-family: "OpenSansNormal", sans-serif;
                             text-align: center;
                             width: 100%;
                         }
                     }

                         .top {
                             display: flex;
                             flex-direction: row;
                             justify-content: space-between;
                             padding: 0px 16px;
                         }

                         .company-name {
                             font-size: 12px;
                             color: var(--dark-blue-text);
                             font-family: "OpenSansBold", sans-serif;
                             letter-spacing: var(--letter-space-05);
                         }

                         .company-cvr {
                             font-size: 12px;
                             color: var(--dark-blue-text);
                             letter-spacing: var(--letter-space-05);
                         }

                         .header {
                             margin: 14px;
                         }

                         .header .subtitle {
                             font-size: 12px;
                             margin: 0;
                             color: var(--dark-blue-text);
                             letter-spacing: 0.1em;
                         }

                         .header h1 {
                             color: var(--dark-blue-text);
                             font-size: 44px;
                             font-family: "OpenSansBolder", sans-serif;
                             letter-spacing: var(--letter-space--03);
                             margin: 0
                         }

                         .chart {
                             background-color: var(--grey-background-color);
                             padding: 16px;
                         }

                         .chart-header {
                             display: flex;
                             justify-content: space-between;
                         }

                         .hourly-coverage {
                             display: flex;
                             flex-direction: column;
                         }

                         .hourly-coverage .title {
                             font-size: 12px;
                             color: var(--dark-blue-text);
                             text-transform: uppercase;
                             letter-spacing: var(--letter-space-05);
                         }

                         .hourly-coverage .value {
                             font-size: 44px;
                             color: var(--dark-blue-text);
                             font-family: "OpenSansBolder", sans-serif;
                             letter-spacing: var(--letter-space--015);
                         }

                         .period {
                             display: flex;
                             flex-direction: column;
                         }

                         .period .title {
                             font-size: 12px;
                             color: var(--dark-blue-text);
                             text-align: end;
                             text-transform: uppercase;
                             letter-spacing: var(--letter-space-05);
                         }

                         .period .value {
                             font-size: 12px;
                             color: var(--dark-blue-text);
                             font-family: "OpenSansBolder", sans-serif;
                             text-align: end;
                             letter-spacing: var(--letter-space-05);
                         }

                         .chart-image {
                             margin-bottom: 20px;
                         }

                         .bar-chart {
                             position: relative;
                             margin-top: -30px;
                             width: 100%;
                         }

                         .hour-numbers {
                             width: 100%;
                         }

                         .legend {
                             height: 100%;
                         }

                         .other-coverage {
                             display: flex;
                             justify-content: space-between;
                         }

                         .other-coverage span {
                             font-size: 10px;
                             color: var(--dark-blue-text);
                             letter-spacing: var(--letter-space--015);
                         }

                         .details {
                             margin: 16px;
                         }

                         .description {
                             font-size: 10px;
                             color: var(--dark-blue-text);
                             margin-top: 0;
                             margin-bottom: 12px;
                             letter-spacing: var(--letter-space--015);
                         }

                         .sections {
                             display: flex;
                             flex-direction: row;
                             justify-content: space-between;
                         }

                         .sections .section-column {
                             min-width: 120px;
                         }

                         .sections .section-column .section-title {
                             margin: 0;
                             font-family: "OpenSansBold", sans-serif;
                             letter-spacing: var(--letter-space--015);
                         }

                         .sections .section-column ul {
                             list-style-type: none;
                             padding: 0;
                             margin: 0;
                         }

                         .sections .section-column ul li {
                             font-size: 10px;
                             letter-spacing: var(--letter-space--015);
                         }

                         .logo-container {
                             display: flex;
                             justify-content: space-between;
                             align-items: center;
                             margin-top: 14px;
                             min-height: var(--logo-height);
                             max-height: var(--logo-height);
                             padding: 0 16px;
                             background-color: var(--grey-background-color);
                         }

                         .logo {
                             width: 110px;
                             max-height: var(--logo-height);
                             margin: 0 20px;
                         }

                         .disclaimer p {
                             padding: 0 16px;
                             margin-top: 10px;
                             margin-bottom: 10px;
                             font-size: 6.3px;
                         }
                     </style>
                     """;
        return html.Trim();
    }
}
